import React, { useState, useEffect } from 'react';
import './WelcomePage.css';

function WelcomePage({ onGetStarted }) {
  const [step, setStep] = useState(0);

  useEffect(() => {
    if (step < 3) {
      const timer = setTimeout(() => {
        setStep(step + 1);
      }, 2500);
      return () => clearTimeout(timer);
    }
  }, [step]);

  return (
    <div className="welcome-page">
      <div className="animated-background">
        <div className="gradient-orb orb-1"></div>
        <div className="gradient-orb orb-2"></div>
        <div className="gradient-orb orb-3"></div>
      </div>

      <div className="welcome-content">
        {step === 0 && (
          <div className="welcome-step fade-in">
            <div className="icon-large">üí≥</div>
            <h1 className="welcome-title">Smart Expense Tracker</h1>
            <p className="welcome-subtitle">AI-powered insights from raw statements</p>
          </div>
        )}

        {step === 1 && (
          <div className="welcome-step slide-in">
            <div className="feature-showcase">
              <div className="feature-item">
                <div className="feature-icon">üìù</div>
                <h3>Paste Raw Data</h3>
                <p>Copy transactions directly from your bank</p>
              </div>
              <div className="feature-item">
                <div className="feature-icon">ü§ñ</div>
                <h3>AI Processing</h3>
                <p>Automatic vendor cleanup & categorization</p>
              </div>
              <div className="feature-item">
                <div className="feature-icon">üìä</div>
                <h3>Smart Insights</h3>
                <p>Visual breakdowns & Excel exports</p>
              </div>
            </div>
          </div>
        )}

        {step === 2 && (
          <div className="welcome-step zoom-in">
            <div className="demo-preview">
              <div className="demo-card">
                <div className="demo-line"></div>
                <div className="demo-line short"></div>
                <div className="demo-line"></div>
                <div className="demo-line medium"></div>
              </div>
              <div className="arrow-transform">‚Üí</div>
              <div className="demo-card structured">
                <div className="demo-chip">üõí Grocery</div>
                <div className="demo-chip">üçî Restaurants</div>
                <div className="demo-chip">üöó Transportation</div>
              </div>
            </div>
            <h2 className="transform-text">Transform Chaos into Clarity</h2>
          </div>
        )}

        {step === 3 && (
          <div className="welcome-step final-step">
            <div className="pulse-icon">‚ú®</div>
            <h1 className="ready-title">Ready to Get Started?</h1>
            <button className="get-started-btn" onClick={onGetStarted}>
              <span>Let's Go</span>
              <span className="btn-arrow">‚Üí</span>
            </button>
            <p className="skip-text" onClick={onGetStarted}>or skip intro</p>
          </div>
        )}
      </div>

      <div className="progress-dots">
        {[0, 1, 2, 3].map(i => (
          <div
            key={i}
            className={`dot ${step >= i ? 'active' : ''}`}
          />
        ))}
      </div>
    </div>
  );
}

export default WelcomePage;
